css:
.sheet-toolbar .btn-toolbar img.content-mask {
  background-color: #f6f6f6;
}
.sheet-toolbar-container {
  background-image: -webkit-linear-gradient(top, #41403b, #34332f);
  box-shadow: none;
}
.sheet-toolbar-container .btn {
  background: #4c4b45;
}
.sheet-toolbar-container .btn.btn-toolbar {
  color: #f6f6f6;
}
.sheet-toolbar-container .toolbar-activity .activity-toolbar-icon {
  background: #f6f6f6;
}
.sheet-toolbar .item-back img.content-mask {
  background-color: #f6f6f6;
}
.sheet-toolbar .item-back .item-back-title {
  color: #f6f6f6;
}
.sheet-toolbar .selection-bar .absolute {
  border-color: #4e4d47;
  background-color: #2c2b28;
}
.sheet-toolbar .selection-bar .absolute .inner .centered {
  color: #f6f6f6;
}
.btn-icon img.content-mask {
  background-color: #f6f6f6;
  color: #f6f6f6;
}
.btn-icon img.content-mask:hover {
  background-color: #f07746;
}
.send-later .menu {
  width: 250px;
}
.send-later .menu .item .time {
  display: none;
  float: right;
  padding-right: 12px;
}
.send-later .menu .item.selected .time,
.send-later .menu .item:hover .time {
  display: inline-block;
}
.send-later .divider {
  border-top: 1px solid #ffffff;
}
.send-later .custom-section {
  padding: 7.5px 12px;
}
.send-later .cancel-section {
  padding: 5px 12px;
  padding-bottom: 6px;
}
.send-later .cancel-section .btn {
  width: 100%;
}
.btn-send-later .at {
  margin-left: 3px;
}
.send-later-status {
  display: flex;
  align-items: center;
}
.send-later-status .time {
  font-size: 0.9em;
  opacity: 0.62;
  color: #f07441;
  font-weight: 400;
}
.send-later-status img {
  width: 38px;
  margin-left: 15px;
}
